import React, { Component } from 'react'
import Avatar from 'react-avatar';

export default class TreeItem extends Component {
  render() {
    return (
      <div>
        <div className="treeItem">
            <div>
            <Avatar name="Foo Bar" size="20" round={true} />
            </div>
            <div></div>
            <div></div>
        </div>
      </div>
    )
  }
}
